import { Button } from "@cargoship/ui";
import { ArrowRightCircleIcon } from "@heroicons/react/24/outline";
import { useState } from "react";
import ImageUploading, { ImageType } from "react-images-uploading";

export function ImageClassificationDemo() {
  const [prediction, setPrediction] = useState("seashore, coast, seacoast, sea-coast");
  const [loading, setLoading] = useState(false);
  const [image, setImate] = useState<ImageType>(defaultImage);

  const onChange = (image: any) => {
    setImate(image);
  };

  const makePrediction = async () => {
    setLoading(true);
    const base64Image = Array.isArray(image) ? image[0].data_url.split(",")[1] : image.data_url.split(",")[1];
    const res = await fetch("https://image-classification.api.stackocean.com", {
      method: "POST",
      headers: {
        "Content-Type": "application/json",
        "X-API-Key": "stackocean4",
      },
      body: JSON.stringify({
        base64: base64Image,
      }),
    });
    if (!res.ok) {
      console.log("error");
      setLoading(false);
      return;
    }
    const data = await res.json();
    setPrediction(data.prediction);
    setLoading(false);
  };

  return (
    <div>
      <div className="relative grid grid-cols-1 gap-3 rounded-lg border-2 border-white/10 bg-white/5 backdrop-blur sm:grid-cols-2">
        <div className="p-5">
          <h3 className="m-0 text-xl">Image</h3>
          {/* @ts-ignore */}
          <ImageUploading value={image} onChange={onChange} dataURLKey="data_url" maxFileSize={3000000}>
            {({ imageList, onImageUpload, dragProps, errors }) => (
              // write your building UI
              <div className="upload__image-wrapper">
                <div
                  className="mt-4 cursor-pointer rounded border-2 border-dashed border-slate-300 p-2"
                  onClick={onImageUpload}
                  {...dragProps}>
                  {imageList.map((image, index) => (
                    <div key={index} className="image-item">
                      <img src={image["data_url"]} alt="" className="h-48 w-96 object-contain" />
                      <div className="image-item__btn-wrapper"></div>
                    </div>
                  ))}
                  <p className="w-full text-center text-xs text-slate-500">
                    Drag and Drop or click
                    <br />
                    to upload your own image
                  </p>
                </div>
                {errors?.maxFileSize && <span>Selected file size exceed maxFileSize</span>}
              </div>
            )}
          </ImageUploading>
          <Button type="submit" className="mt-4 w-full justify-center" onClick={() => makePrediction()}>
            Make Prediction
          </Button>
        </div>
        <div className="rounded-lg bg-white/5 p-5">
          <h3 className="m-0 inline-flex items-center text-xl">
            <ArrowRightCircleIcon className="mr-1 h-6 w-6" /> Predicted Class
          </h3>
          <div className="mt-1">
            <p className="m-o text-white">{prediction}</p>
          </div>
        </div>
        {loading && (
          <div className="absolute inset-0 flex items-center justify-center bg-slate-900/20">
            <div className="flex flex-col items-center space-y-2">
              <div className="h-10 w-10 animate-spin rounded-full border-t-2 border-b-2 border-white"></div>
            </div>
          </div>
        )}
      </div>
      <p className="text-xs text-slate-500">
        This demo runs on a virtual server with 4 vCPUs and 16 GB Ram (~$20/month)
      </p>
    </div>
  );
}

const defaultImage = [
  {
    data_url:
      "data:image/jpeg;base64,",
    file: {},
  },
];
